import React, { useEffect, useState } from 'react';
import { request_token } from '../tools/ApiCalls';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import { api_link, api_key } from '../../globals';

import Avatar from '@material-ui/core/Avatar';
import Container from '@material-ui/core/Container';

import ReactPlayer from 'react-player'

const useStyles = makeStyles((theme) => ({
	root: {

	},
	paper: {
		padding: theme.spacing(2),
		textAlign: 'center',
		color: theme.palette.text.secondary,
	},
	larger: {
		width: "100%",
		opacity: 0.7,
	},
	paperthree: {
		textAlign: 'center',
		backgroundSize: 'cover',
		backgroundRepeat: 'no-repeat',
		backgroundPosition: 'center',
		width: "calc(100% + 12px)",
		left: 0,
		top: 64,
		position: "absolute",
	},

}));

const defaultProps = {
	bgcolor: 'background.paper',
	m: 1,
	style: { width: '5rem', height: '5rem' },
	borderColor: 'text.primary',
};

export default function About() {
	const classes = useStyles();
	const [data, setData] = useState();


	useEffect(() => {
		const request = async () => {
			const url = api_link + '/movie/popular';
			const new_url = url.concat('?api_key=', api_key);
			const response = await fetch(new_url, {
				method: 'GET',
				headers: {
					'Accept': 'application/json',
					'Content-type': 'application/json'
				}

			});
			setData(response)
			console.log(data)

		}
		request()
	}, []);

	return (
		<div className={classes.root}>
			<Container>
				<Grid container spacing={3} className={classes.paperthree}>
					<ReactPlayer
						loop="true"
						playing="true"
						playsinline
						url="https://youtu.be/fV5uoOf345Y"
						controls="true"
						muted
						fluid="false"
						width="calc(100% + 12px)"
						height="calc(100vw / (16/9))"
						className={classes.larger} />
				</Grid>
			</Container>
		</div>
	);
}
